(103, 1, '2016-10-26 14:42:32', '2016-10-26 11:42:32', '<div class="ab-red-ramka">\r\n<div class="ab-red-ramka-title">Содержание</div>\r\n<ul>\r\n 	<li><span class="ab-tsifra">1.</span>Для этой цели используется специальный</li>\r\n 	<li><span class="ab-tsifra">2.</span>Для начала следует вспомнить, что представляет собой натяжной потолок</li>\r\n 	<li><span class="ab-tsifra ab-tsifra-2">2.1</span>Если нельзя потолочный плинтус или галтель закрепить</li>\r\n 	<li><span class="ab-tsifra">3.</span>Крепление потолочного плинтуса</li>\r\n</ul>\r\n</div>\r\n<div class="ab-single-txt">Декоративный плинтус бывает выполнен из различных материалов и самым дешевым является пенопластовый. Он имеет очень маленький вес и легко приклеивается прямо к обоям. Существует большой ассортимент его видов.</div>\r\n<div class="ab-single-second-title">Для этой цели используется специальный</div>\r\n<div class="ab-single-txt">Его установка является само собой разумеющейся операцией при выполнении</div>\r\n<div class="ab-txt-img">\r\n<div class="ab-txt-img-left"><img class="img-responsive" src="http://potolky/img/ab-img-1.png" alt="">Классический натяжной потолок</div>\r\n</div>\r\n<div class="ab-single-txt ab-single-txt-2">\r\n\r\nДекоративный плинтус бывает выполнен из различных материалов и самым дешевым является пенопластовый. Он имеет очень маленький вес и легко приклеивается прямо к обоям. Существует большой ассортимент его видов.\r\n\r\nНо этот материал имеет и несколько недостатков, основным из которых является его хрупкость.\r\n\r\n</div>\r\n<div class="clearfix">&nbsp;</div>\r\n<div class="ab-single-txt">Потолочные пластиковые изделия выпускаются в большой цветовой гамме и разнообразной формы. Они тоже небольшого веса и легко приклеиваются. Срок их службы большой.</div>\r\n<div class="ab-italic-txt">Не самый распространенный, но все же имеющий место быть вариант — деревянный.Они выглядят натурально и очень красиво.Если в интерьере присутствуют декоративные деревянные элементы, то его использование вполне уместно, хотя прекрасной альтернативой являются галтели из вышеуказанных материалов.</div>\r\n<div class="ab-single-txt">Изделия выпускаются в большой цветовой гамме и разнообразной формы. Они тоже небольшого веса и легко приклеиваются. Срок их службы большой.</div>\r\n<div class="ab-italic-txt-2">\r\n<ol>\r\n 	<li>А теперь непосредственно о том, как клеить потолочный плинтус.</li>\r\n 	<li>При использовании первого и второго вида галтелей их можно клеить прямо на обои, т.к. их вес незначительный.</li>\r\n 	<li>После этого необходимо нанести клей на плинтус и прижать его. Сложности могут возникнуть при стыковке углов.</li>\r\n</ol>\r\n</div>\r\n<blockquote class="ab-tsitata-1">Деревянные галтели фиксируются на крепежных элементах, закрепляемых на стене. Для них также отмеряется нужное расстояние от натяжного потолка. После установки крепежных элементов к ним прибивается непосредственно плинтус.</blockquote>\r\n<div class="ab-single-second-title ab-single-second-title-2">Для начала следует вспомнить, что представляет собой натяжной потолок</div>\r\n<div class="ab-single-txt">При использовании полиуретановых изделий из-за большей массы следует клеить их на чистую стену, а для этого придется подрезать обои или клеить.</div>\r\n<div class="ab-single-txt ab-single-txt-2 ab-single-txt-3">Не самый распространенный, но все же имеющий место быть вариант — деревянный. Они выглядят натурально и очень красиво. Если в интерьере присутствуют декоративные деревянные элементы, то его использование вполне уместно, хотя прекрасной альтернативой являются галтели из вышеуказанных материалов. Полиуретановые изделия используются очень часто. Они достаточно гибкие и долговечные. Но есть у них и недостатки</div>\r\n<div class="ab-txt-img">\r\n<div class="ab-txt-img-left"><img class="img-responsive" src="http://potolky/img/ab-pot.jpg" alt="">Классический натяжной потолок</div>\r\n</div>\r\n<div class="clearfix">&nbsp;</div>\r\n<blockquote class="ab-tsitata-2">\r\n<div class="ab-div-kav">“</div>\r\nПотолочные пластиковые изделия выпускаются в большой цветовой гамме и разнообразной формы. Они тоже небольшого веса и легко приклеиваются. Срок их службы большой.</blockquote>\r\n<div class="ab-single-second-title ab-single-second-title-2 ab-single-second-title-3">Если нельзя потолочный плинтус или галтель закрепить</div>\r\n<div class="ab-single-txt">Декоративный плинтус бывает выполнен из различных материалов и самым дешевым является пенопластовый. Он имеет очень маленький вес и легко приклеивается прямо к обоям. Существует большой ассортимент его видов.</div>\r\n<div class="ab-video">\r\n\r\n<a class="ab-a-next" href="http://potolky/single.php#"><img class="img-responsive" src="http://potolky/img/ab-video.jpg" alt=""></a>\r\n<div class="ab-vid-next">Потолочные пластиковые изделия выпускаются в большой цветовой</div>\r\n</div>\r\n<div class="ab-single-second-title ab-single-second-title-2 ab-single-second-title-4">Крепление потолочного плинтуса</div>\r\n<div class="ab-single-txt ab-single-txt-new">\r\n\r\nДля начала следует вспомнить, что представляет собой натяжной потолок. Это ткань или пленка из ПВХ, которые натягиваются и закрепляются в профиль. Они находятся в натянутом состоянии и удерживаются только по периметру. Никакого жесткого крепления у них нет. Как же клеить потолочный плинтус? Никак. Этого делать нельзя. И на то есть несколько причин.\r\n\r\n<span class="ab-bold">Во-первых,</span> из-за особенностей установки используемого в конструкции материала после фиксирования планки клеевой шов может просто отойти.\r\n\r\n<span class="ab-bold">Во-вторых,</span> из-за применяемого клея может испортиться полотно. Вот и получается, что клеить потолочные плинтуса к натяжным потолкам нельзя. Тогда каким образом решить проблему декорирования щели между стеной и потолком?\r\n\r\n</div>\r\n<table class="ab-table">\r\n<tbody>\r\n<tr class="ab-table-title">\r\n<td>Наименование</td>\r\n<td>Описание</td>\r\n</tr>\r\n<tr class="ab-table-main">\r\n<td>Для начала следует вспомнить, что представляет</td>\r\n<td>Конструкции материала после фиксирования планки клеевой шов может просто отойти.</td>\r\n</tr>\r\n<tr class="ab-table-main">\r\n<td>Конструкции материала после фиксирования\r\nпланки</td>\r\n<td>Вот и получается, что клеить потолочные плинтуса к натяжным потолкам нельзя. Тогда каким образом решить проблему</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class="ab-single-txt">Никакого жесткого крепления у них нет. Как же клеить потолочный плинтус? Никак. Этого делать нельзя. И на то есть несколько причин.</div>', 'Реечные потолки', '', 'publish', 'open', 'open', '', 'reechnye-potolki', '', '', '2016-10-26 16:37:41', '2016-10-26 13:37:41', '', 0, 'http://potolky2.loc/?p=103', 0, 'post', '', 0),
